		console.log("not cleared-testing");
		refID = requestAnimationFrame(animationReady)

			$(".waiting-holder").hide();
			__startAnimation = false;
			__preloadComplete = false;
			console.log("cleared-testing");
			cancelAnimationFrame(refID)
